using System;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using ImageUpload;
using System.IO;

namespace UnitTestProject1
{
    [TestClass]
    public class UnitTest1
    {
        [TestMethod]
        public void TestProcessFromFile()
        {
            bool ok = true;
            try
            {
                ImageProcessor ip = new ImageProcessor();
                ip.fromFile(Directory.GetCurrentDirectory()+"\\googlelogo.png");
            }
            catch (Exception ex) {
                ok = false;            
            }

            Assert.AreEqual(true, ok);
        }

        [TestMethod]
        public void TestProcessFromUrl()
        {
            bool ok = true;
            try
            {
                ImageProcessor ip = new ImageProcessor();
                ip.fromUrl("https://www.google.com/images/branding/googlelogo/2x/googlelogo_color_272x92dp.png");
            }
            catch (Exception ex)
            {
                ok = false;
            }

            Assert.AreEqual(true, ok);
        }

        [TestMethod]
        public void TestProcessFromBase64()
        {
            bool ok = true;
            try
            {
                ImageProcessor ip = new ImageProcessor();
                ip.from64("");
            }
            catch (Exception ex)
            {
                ok = false;
            }

            Assert.AreEqual(true, ok);
        }
    }
}
